const Form = (props) =>{
    const FormHandler = (event)=>{
        event.preventDefault()
    }
    return(
        <form onSubmit={FormHandler}>
            <label>Name</label>
            <input
                type="text"
                value={props.data.name}
            />
        </form>
    )
}
export default Form;
